import React from "react";
import { Link } from "react-router-dom";
import Button from "../components/Button/Button";
import Greeting from "../components/Greeting/Greeting";
//const img = document.createElement("graphics/app_logo_big.png");
//img.src = "../graphics/app_logo_big.png";
//document.body.appendChild(img);

export default function Welcome() {
  return (
    <div className="welcome-page">
      <Greeting />
      <div>
        <div className="Greeting_title">Welcome to Tripster</div>
        <div className="Little_Greeting">
          Connect and chat with fellow travellers
        </div>
      </div>
      <img src="graphics/app_logo_small.png" alt="Tripster Logo"></img>
      <Link to="/signup">
        <Button text="Signup" type="signup" />
      </Link>
      <Link to="login">
        <Button text="Log in" type="login" />
      </Link>
    </div>
  );
}
